CREATE TABLE `amz_shipment_item` (
  `seller_id` int(11) unsigned NOT NULL COMMENT '卖家ID',
  `mws_id` int(11) unsigned NOT NULL COMMENT '平台接口ID',
  `snapshot_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '数据截取时间',
  `shipment_id` varchar(45) NOT NULL COMMENT '与物流包裹主表关联,`amz_shipment`主键',
