  `quantity_in_case` int(10) unsigned NOT NULL COMMENT '多少个产品装一箱',
  `quantity_received` int(10) unsigned NOT NULL COMMENT '平台收到货后,已清点数量',
  `yFlag` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`mws_id`,`shipment_id`,`seller_sku`)
